import React from 'react';
import '../../assets/style/FlightHistoryCard.css';

const FlightHistoryCard = ({ flight }) => {
    const {
        airlineLogo,
        departureTime,
        arrivalTime,
        airlineName,
        stopCount,
        flightDuration,
        departureCode,
        arrivalCode,
        flightCode,
        price,
        flightPackage,
    } = flight;

    return (
        <div className="flight-history-card">
            <div className="history-left-section">
                <img src={airlineLogo} alt={airlineName} className="airline-logo" />
                <div className="time-info">
                    <div className="time">
                        <strong>{departureTime}</strong> - <strong>{arrivalTime}</strong>
                    </div>
                    <div className="airline-name">{airlineName}</div>
                    <button className="flight-details-btn">Flight Details</button>
                </div>
            </div>

            

            <div className="history-right-section">
                <div className="price-info">
                    <div className="price">{price}</div>
                    <div className="flight-package">{flightPackage}</div>
                </div>
            </div>
        </div>
    );

};

export default FlightHistoryCard;
